import React, { Fragment } from 'react'
import Header from './Header'

const Home = () => {
    return (
        <Fragment>
            <Header />
            <section>
                <p className='slogan bold center'>L'amour en quelques clics...</p>
                <a class="btn btn-info btn-sm sign-up" href="#" role="button">S'inscrire</a>
            </section>
        </Fragment>
    );
}

export default Home
